import { ActionTypes } from "../constants/ActionTypes"

const initialState = {
    products: [{
        id: 1,
        title: "bhavik",
        category: "computer"
    }]
}

export const ProductReducer = (state= initialState, {type, payload}) =>{
    switch (type) {
        case ActionTypes.SET_PRODUCTS :
            return state

        default:
            return state
    }
}
